import styled from 'styled-components';

export const CoinApp = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-top: 64px;
    color: #fff;
`

export const CoinsSearch = styled.div`
    margin-bottom: 64px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
`

export const CoinText = styled.h1`
    margin-bottom: 32px;
    text-align: center;
`
